import React, { Component } from 'react';
import './App.css';

class Card extends Component {
    render() {
        // console.log(this.props.q)
        return(
            <div>
            {this.props.q.map(question => {
                return (<div className="card" key={question.text}>{question.text}</div>

            )})}
            </div>
        )
    }
}

export default Card;
